import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import { robots } from './Robots'
import * as serviceWorker from './serviceWorker';
import 'tachyons';

ReactDOM.render(
    <div>
        <Card id={robots[0].id}/>
        <Card id={robots[1].id}/>
        <Card id={robots[2].id}/>
        <Card id={robots[3].id}/>
        <Card id={robots[4].id}/>
        <Card id={robots[5].id}/>
    </div>, 
    document.getElementById('root')
);

serviceWorker.unregister();
